import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');


class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: ''
		}
	}

	getImages = () => {
		return new Promise((resolve, reject) => {
			const client = new AccountClient('http://localhost:8080');
			const request = new imageData();
			client.imageTest(request, {}, (err, reply) => {
				if (err) {
					console.log(err.code);
					console.log(err.message);
				} else {
					const data = reply.getImage_asB64();
					return data;
				}
			})
		})
	}
	Example =  ({ data }) => <img src={`data:image/jpeg;base64,${data}`} alt='' />

	return_b64 = async () => {
		const data = await this.getImages();

	}

	render() {
		const data2 = this.getImages();
		return (
			<div>
				{/* {/* <a data={this.state.image} /> */}
				{/* {document.getElementById('container')} */}
				<this.Example data={data2} />
				{document.getElementById('container')}
				<div id="container"></div>
				<div>test page</div>
			</div>
		)
	}
}

export default Test;
